function RoundsPurchased({ rounds, onDeleteRound }) {
  console.log(rounds);
  const roundsButton = rounds.map((round) => {
    return (
      <div>
        <h3>${round.price}</h3>
        <button onClick={onDeleteRound}>Delete</button>
      </div>
    );
  });

  return <div>{roundsButton}</div>;
}
export default RoundsPurchased;
